import type { AssetType } from "./AssetType";
import type { CheckpointData } from "./CheckpointData";
import type { FileData } from "./FileData";
import type { LoraData } from "./LoraData";
import type { Status } from "./Status";
import type { TextualInversionData } from "./TextualInversionData";
import type { VAEData } from "./VAEData";
import type { VolumeData } from "./VolumeData";
export type Asset = {
    /**
     * Asset type.
     */
    asset_type: AssetType;
    /**
     * Asset creation time.
     */
    created_at: string;
    /**
     * Asset data.
     */
    data: FileData | CheckpointData | LoraData | TextualInversionData | VAEData | VolumeData;
    /**
     * Description.
     */
    description: string;
    /**
     * Asset id.
     */
    id: string;
    /**
     * True if asset is public.
     */
    is_public?: boolean;
    /**
     * Asset name.
     */
    name: string;
    /**
     * Size in bytes.
     */
    size_bytes: number;
    /**
     * Asset status.
     */
    status: Status;
    /**
     * Asset status.
     */
    status_details: string;
    /**
     * Asset tenant ID.
     */
    tenant_uuid: string;
};
